import React from "react";

import Menu from "../components/Menu";

import 'bootstrap/dist/css/bootstrap.min.css';

function Login() {
    return (
        <div>
            <Menu />

            <div>
                <h1 className="login_title">Login</h1>
                <form></form>
                <label className="user">Usuario</label>
            </div>

             
        </div>
    );
}

export default Login;
